function Home() {
  return (
    <div>
      <button onClick={()=>(window.location.href='/additem')} className="btn btn-primary">Add Item</button>
      <button onClick={()=>(window.location.href='/allitems')} className="btn btn-primary">All Items</button>

    </div>
  )
}

export default Home;
